import React from "react";
import classes from "./Button.module.css";
import ReactTooltip from "react-tooltip";

const button = props => (
  <>
    <button className={classes.Button} onClick={props.clicked} event="click">
      Copy
    </button>
    <ReactTooltip />
    <Button data-tip data-for="clickme" data-event="click">
          copy
        </Button>
        <ReactTooltip
          id="clickme"
          place="right"
          effect="solid"
          clickable={true}
        >
          <p>copied</p>
        </ReactTooltip>
  </>
);

export default button;
